import clickAudio from "../../click_audio_func/click_audio_func";
import hoverAudio from "../../hover_audio_func/hover_audio_func";
import "../css/side_bar.css";
export default function SideBar() {

  const overlay = {
    position: "absolute",
    width: "100%",
    height: "100%",
    backgroundColor: "rgba(0, 0, 0, 0.1)",
    zIndex: "1",
    display: "none",
  };

  return (
    <div className="side-bar-main-container">
      <div className="menue-part-side-bar">
        <div onMouseOver={() => hoverAudio()} onClick={() => clickAudio()}>Report <span><i class="fa-solid fa-circle-exclamation"></i></span><div style={overlay}></div></div>
        <div  onMouseOver={() => hoverAudio()} onClick={() => clickAudio()}><i class="fa-solid fa-gear"></i><div style={overlay}></div></div>
      </div>
    </div>
  );
}
